const getPlayerBySearch = `-- name: GetPlayerBySearch :many
select
    id, fullname
from
    player
where
    name like '%' || $1 || '%'
`

func (q *Queries) GetPlayerBySearch(ctx context.Context, dollar_1 pgtype.Text) ([]Player, error) {
	rows, err := q.db.Query(ctx, getPlayerBySearch, dollar_1)
	if err != nil {
		return nil, err
	}
	defer rows.Close()
	var items []Player
	for rows.Next() {
		var i Player
		if err := rows.Scan(&i.ID, &i.Fullname); err != nil {
			return nil, err
		}
		items = append(items, i)
	}
	if err := rows.Err(); err != nil {
		return nil, err
	}
	return items, nil
}

